import Article from "./backend_component/article";
import Sidebar from "./backend_component/sidebar";
import Title from "./backend_component/title";
import { manager_sidebar } from "./api";


const Manager=()=>{
    var banch=window.sessionStorage.getItem('banch');
    const manager_sidebar= [banch+'每月考核','登出'];


    return(

    <>
    <div className="head">
        <Title/>
        <Sidebar sidebar_arr={manager_sidebar} style={"lesssmall"} />
        <Sidebar sidebar_arr={manager_sidebar} style={"small"} />
    </div>

    <div className="body"> 
        <Sidebar sidebar_arr={manager_sidebar} style={"large"}/>
        <Article/>
    </div>
    </>

    )
}
export default Manager;
